import React from 'react';
import './Form.css';

function Form() {
    return (
        <div className="form">
            <h2>Aromatic Bar</h2>
            <p>We are committed to providing you with the best
                dining experience possible, so we welcome your comments. Please fill
                out this questionnaire. Thank you.
            </p>

            <form className="form__container">
                <label for="customer__name">Customer's Name</label>
                <input type="text" maxLength="50" name="customer__name"/>

                <label for="customer__number">Mobile Number</label>
                <input type="tel" maxLength="50" name="customer__number"/>
            </form>

        </div>
    )
}

export default Form;
